export const input = (data) => campos.map((data)=>{
    return (
        <div>

        <input type="radio"
    id={data.id}
    name={data.name}
    value={data.value}
    onChange={this.selectedChangeOrigem}
    />
<label className="property-options" htmlFor={data.id}
    children={data.children} />
    </div>
    )
})
